INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-404-13089-4', 'Shining', 'Stephen King', 'Ein Hotel in den Bergen von Colorado. Jack Torrance, ein verkrachter Intellektueller mit Psycho-Problemen, bekommt den Job als Hausmeister, um den er sich beworben hat. Zusammen mit seiner Frau Wendy und seinem Sohn Danny reist er in den letzten Tagen des Herbstes an. Das Hotel \"Overlook\" ist ein verrufener Ort.\r\nWer sich ihm ausliefert, verfällt ihm, wird zum ausführenden Organ aller bösen Träume und Wünsche, die sich in ihm manifestieren.\r\nDer Alptraum beginnt ...\r\n', 13.00, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-426-51944-8', 'Der Insasse', 'Sebastian Fitzek', ' Zwei entsetzliche Kindermorde hat er bereits gestanden und die Berliner Polizei zu den grausam entstellten Leichen geführt. Doch jetzt schweigt Guido T., der im Hochsicherheitstrakt der Psychiatrie einsitzt, auf Anraten seiner Anwältin. Die Polizei ist sicher: Er ist auch der Entführer des sechsjährigen Max, der seit einem Jahr spurlos verschwunden ist. Die Ermittler haben jedoch keine belastbaren Beweise, nur Indizien. Und ohne die Aussage des Häftlings werden Max\' Eltern keine Gewissheit haben und niemals Abschied von ihrem Sohn nehmen können.\r\n\r\nMonate nach dem Verschwinden von Max macht ein Ermittler der Mord-Kommission dem verzweifelten Vater ein unglaubliches Angebot: Er schleust ihn in das psychiatrische Gefängnis-Krankenhaus ein, in dessen Hochsicherheitstrakt Guido T. eingesperrt ist. Als falscher Patient, ausgestattet mit einer fingierten Krankenakte. Damit er dem Kindermörder so nahe wie nur irgend möglich ist und ihn zu einem Geständnis zwingen kann.\r\n\r\nDenn nichts ist schlimmer als die Ungewissheit.\r\n\r\nDachte er.\r\n', 11.99, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-458-68288-2', 'Eine glückliche Familie', 'Jackie Kabler', 'Als Beth zehn Jahre alt war, hat ihre schöne Mutter die Familie ohne ein Wort verlassen. Beths Vater versuchte mit allen Kräften den Verlust wettzumachen, aber natürlich gab es Probleme, und Beth trägt ein dunkles Geheimnis mit sich herum, von dem außer ihrem Vater niemand etwas weiß.\r\nInzwischen ist Beth erwachsen und rundum zufrieden. Sie hat zwei wohlgeratene Kinder, einen interessanten Job, gute Freundinnen, und sie kümmert sich liebevoll um ihren alten Vater. Und dann steht eines Tages plötzlich diese ältere Frau vor ihrer Tür und behauptet, ihre lang verschollene Mutter zu sein. Beth ist zunächst schockiert, aber dann scheint sich alles aufs Schönste zu fügen. Doch nach und nach passieren merkwürdige Dinge: Beth fühlt sich von einem Mann verfolgt, sie verliert ihre Schlüssel, das Handy ist weg, die Freundinnen wenden sich ab. Beth fürchtet den Verstand zu verlieren. Werden die Schatten der Vergangenheit sie schließlich doch einholen? ', 12.00, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-551-35401-3', 'Harry Potter und der Stein der Weisen', 'J. K. Rowling', 'Bis zu seinem elften Geburtstag glaubt Harry, er sei ein ganz normaler Junge. Doch dann erfährt er, dass er sich an der Schule für Hexerei und Zauberei einfinden soll – denn er ist ein Zauberer! In Hogwarts stürzt Harry von einem Abenteuer ins nächste und muss gegen Bestien, Mitschüler*innen und Fabelwesen kämpfen. Da ist es gut, dass er schon Freunde gefunden hat, die ihm im Kampf gegen die dunklen Mächte zur Seite stehen.  \r\n\r\nEin generationenübergreifender Fantasy-Klassiker \r\n\r\nMillionen von Leser*innen und mehrere Generationen sind mit den Geschichten von Harry Potter aufgewachsen. Die Autorin hat mit Hogwarts ein Universum geschaffen, das einzigartig ist und eine immense kulturelle Bedeutung erlangt hat. Neben der magischen Welt und spannenden Abenteuern spielen auch moralische Werte wie Freundschaft, Toleranz, Loyalität und der Einsatz für das Gute eine wichtige Rolle.\r\n\r\nDer erste Band als ungekürzte Taschenbuch-Ausgabe – für Harry-Potter-Fans und solche, die es werden wollen!', 10.00, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-7363-2073-4', 'Coldhart - Strong & Weak', 'Lena Kiefer', '\r\nElijah Coldwell hat sein Leben unter Kontrolle: Studium, Firma, Sport, alles ist strengstens durchorganisiert. Die Ängste, die ihn seit einer Entführung in der Kindheit quälen, hat er auf diese Weise im Griff. Nur sich zu verlieben, kommt für ihn nicht infrage, zu groß ist das Risiko, noch einmal so verwundbar zu sein wie damals. Doch dann trifft er auf Felicity Everhart, die ihn mehr fasziniert als irgendjemand zuvor. Eigentlich hat Felicity gerade andere Sorgen, bemüht sie sich doch vergebens darum, endlich ihrem Vater näherzukommen, der zwar ihr Traumstudium an der Kunsthochschule in New York finanziert, von dem sie sonst jedoch kaum etwas weiß. Aber das, was zwischen ihnen ist, können weder Elijah noch Felicity lange ignorieren – nicht ahnend, dass ihre Liebe unter denkbar schlechten Vorzeichen steht. Denn als Elijah neue Hinweise zu seinen Kidnappern erhält, führt die Spur ausgerechnet zu Felicity Vater ...', 14.90, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-8310-4844-1', 'Healing Kitchen - Quick & Easy', 'Shabnam Rebo', 'Jetzt lässt sich die entzündungshemmende Ernährung noch leichter in den Alltag integrieren: Nachdem Shabnam Rebo (bei Instagram bekannt als „The Hungry Warrior“) bereits in ihrem ersten Buch „Healing Kitchen“ eindrucksvoll bewiesen hat, wie genussvoll die antientzündliche Ernährung sein kann, beweist sie in ihrem zweiten Kochbuch anhand von über 80 schnellen Rezepten einmal mehr, wie einfach entzündungshemmendes Essen sein kann!\r\n\r\nVegane Rezepte aus der wohltuenden Healing Kitchen:\r\n- Über 80 Gerichte auf Basis pflanzlicher und entzündungshemmender Nahrungs- und Lebensmittel\r\n- Die meisten der köstlichen Anti-Entzündungsrezepte aus der veganen Küche kann in unter 30 Minuten zubereitet werden.\r\n- Unkomplizierte Genussrezepte für jeden Anlass, ob Frühstück, Snacks, schnelle Abendessen, Expressgerichte oder Desserts.\r\n- Mit Meal-Prep-Ideen, Tipps für die Vorratskammer und zeitsparender Resteverwertung\r\n\r\nEntzündungshemmende Ernährung leicht gemacht\r\nBrokkoli-Ceasar-Salad mit crunchy Kichererbsen, Auberginenbällchen à la Caponata oder cremiges One-Pot-Pilz-Orzo: Die kreativen anti-entzündlichen Rezepte lassen sich einfach in den Alltag integrieren, egal ob für ein leckeres Frühstück, eine super-schnelle Feierabendküche oder ausgiebigen Genuss mit Freund*innen und Familie. Dabei unterstützt Shabnam Rebo mit Hilfestellungen und Tipps zur anti-inflammatorischen Ernährung, durch die sie ihre eigene Autoimmunerkrankung erfolgreich in den Griff bekommen hat.', 24.95, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-8362-8452-3', 'Algorithmen in Java', 'David Kopec', 'Programmieren will trainiert werden, und Algorithmen gehören zum Rüstzeug hinzu. Schlagen Sie zwei Fliegen mit einer Klappe und verbessern Sie Ihre Java-Skills anhand klassischer Algorithmen von der Suche im Binärbaum über k-Means bis zum Rucksackproblem. Dieses Buch ist Grundausbildung und Fundgrube für Coding Workouts zugleich. Profitieren Sie von der Lehr- und Praxiserfahrung des Autors: David Kopec hat solche Klassiker für Sie herausgesucht, die wichtige Lösungsstrategien zeigen und einen Trainigseffekt in der Programmierung versprechen. Ideal für alle, die ihre ersten Schritte mit Java hinter sich haben und jetzt voll durchstarten wollen!\r\nAus dem Inhalt:\r\n\r\nZum Einstieg: einfache Verschlüsselung, Fibonacci-Folge, Türme von Hanoi\r\nSuchalgorithmen: DNS-Suche, Labyrinthe u.v.m.\r\nBedingungserfüllung: Wortsuchrätsel, Acht-Damen-Problem u.v.m.\r\nGrafen und kürzeste Wege\r\nk-Means-Clustering\r\nEinfache neuronale Netze\r\nMinimax: Tic-tac.toe, Vier gewinnt', 29.90, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-945493-86-1', 'Krieg der Welten', 'H.G. Wells', 'Als sich außerirdische Flugobjekte der Erde nähern, erfahren die Menschen, dass sie nicht allein im Universum sind. Die Fremden sind den Erdbewohnern technisch weit überlegen und machen schnell klar: sie kommen nicht in Frieden. Als die Invasion der Erde beginnt, entbrennt ein Krieg, bei dem nicht weniger auf dem Spiel steht, als das Überleben der gesamten Menschheit…\r\nDer Krieg der Welten (Original: The War of the Worlds) ist einer der bekanntesten Werke von H. G. Wells. Der erstmals 1898 erschienene Roman über die Invasion der Erde durch Außerirdische ist nach beinahe 120 Jahren immer noch von kultureller und literarischer Bedeutung und beeinflusste zahlreiche fiktionale Werke – angefangen bei Orson Welles‘ berühmtem Hörspiel von 1938 bis hin zu modernen Interpretationen wie Jeff Waynes The Musical Version of The War of the Worlds und Roland Emmerichs Independence Day.\r\n', 14.95, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-95801-135-9', 'Die Kriegswaffen in ihren geschichtlichen Entwicklungen', 'August Demmin', 'Womit kämpften die Römer, welche Waffen gab es im Mittelalter? Diese Enzyklopädie aus dem Jahr 1893 führt durch die Geschichte der Kriegswaffen: Von Speeren, Schleudern und Schwertern über das Rüstzeug bis zur Waffenschmiedekunst – ein über 1000seitiges Nachschlagewerk zum Stöbern und Staunen, für Neugierige und Kenner.\r\n', 79.90, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-95972-455-5', 'Endlich Aktien und Börse verstehen', 'Timo Klein', 'Sein hart erarbeitetes Geld für nahezu null Zinsen auf dem Sparbuch liegen zu lassen, ist nicht sinnvoll. Zwar denken viele Menschen, dass Aktien eine »unsichere Sache« sind, das stimmt so aber nicht. Langfristig gesehen bietet die Börse enorme Chancen.\r\n\r\nWenn du also wissen willst, wie du mehr aus deinem Geld machen kannst, ist dieses Buch genau das Richtige für dich. Denn ich werde dir Schritt für Schritt zeigen, wie du dir mithilfe von Aktien ein Vermögen aufbauen kannst.\r\n\r\n- Zunächst erkläre ich dir die Grundlagen der Börse und gebe dir einen Überblick über die verschiedenen Anlageformen.\r\n- Dann lernst du, wie du vielversprechende Aktien auswählst, zu welchem Zeitpunkt es sinnvoll ist einzusteigen und vor allem welche Strategie am Finanzmarkt die für dich passende ist.\r\n- Ich zeige dir ganz konkret, wie du dein eigenes Depot eröffnest und Aktien kaufst.\r\n- Außerdem gebe ich dir eine kleine Einführung in das Thema Psychologie an der Börse und warne dich vor typischen Anlagefehlern.\r\n\r\nNachdem du dieses Buch gelesen hast, wirst du es kaum erwarten können, endlich in Aktien zu investieren.', 18.00, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-96433-570-8', 'Demon Slayer - Kimetsu no Yaiba 23', 'Koyoharu Gotouge', 'In einer alles entscheidenden letzten Schlacht haben sich Tanjiro und die Demon Slayer dem mächtigsten aller Dämonen entgegengestellt: Muzan Kibutsuji. Sie haben viele Verluste hinnehmen müssen und sind am Ende mit ihren Kräften. Doch bald geht die Sonne auf, und wenn sie Kibutsuji nur noch ein wenig länger in Schach halten können, wird dieser jahrhundertelange Kampf endlich enden. Aber Kibutsuji schreckt vor nichts zurück, um die Demon Slayer ein für alle Mal zu vernichten …\r\nDas Schicksal aller wird sich mit der Morgendämmerung entscheiden.', 12.00, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-96455-168-9', 'Fernweh Camper-Lifehacks - Der perfekte Roadtrip', 'Corinna Harder', 'Mit diesen 50 Tipps wird die Reise zum perfekten Roadtrip. Getreu dem Motto „Lieber 1000 Sterne am Himmel als fünf an der Hoteltür“ gibt es vieles, was das Reisen mit dem Camper so faszinierend macht!', 7.95, '');
INSERT INTO `buch` (`ISBN`, `Titel`, `Autor`, `Beschreibung`, `Preis`, `Titelbild`) VALUES
('978-3-9858811-1-6', 'Michael Jordan. Die Biografie', 'Roland Lazenby', 'Basierend auf zahlreichen Interviews mit Trainern, Freunden, Teamkollegen, Familienmitgliedern und nicht zuletzt mit Jordan selbst, legt Bestsellerautor Roland Lazenby die erste umfassende Biografie des vielleicht allergrössten Helden der Sportgeschichte vor, zumindest des grössten Basketballspielers aller Zeiten. Von Jordans triumphalen Erfolgen auf dem Spielfeld bis hin zu den persöhnlichen Herausforderungen, denen sich der Star stellen musste, bietet dieses Buch einen einzigartigen Einblick in das Leben und die Karriere des Spielers, des Menschen, der Ikone. Ein Muss nicht nur für Basketballfans!', 34.00, '');

